package com.mali.ds.dp.stringsDp;

public class OptimalPartitionOfString {

  public static int partitionString(String s) {

    return recursion(s, 0, new int[26], new int[s.length()], 0);
  }

  static int recursion(String s, int i, int[] arr, int[] dp, int len) {
    if (i >= s.length()) {
      return 1;
    }
    if (dp[i] > 0) {
      return dp[i];
    }
    int ans1 = 0;
    int ans2 = 0;
    if (arr[s.charAt(i) - 'a'] > 0) {
      int[] c = new int[26];
      c[s.charAt(i) - 'a']++;
      dp[i] = 1 + recursion(s, i + 1, c, dp, 0);
    } else {
      arr[s.charAt(i) - 'a']++;
      ans2 = recursion(s, i + 1, arr, dp, len++);
      int[] c = new int[26];
      c[arr[s.charAt(i) - 'a']]++;
      ans1 = 1 + recursion(s, i + 1, c, dp, 0);
      dp[i] = Math.min(ans1, ans2);
    }

    return dp[i];
  }

  public static void main(String[] args) {
    System.out.println(
        partitionString(
            ""));
  }
}
